import React from "react";

const Renderer = (C) => {
  const [selectedRouteIndex, setSelectedRouteIndex] = React.useState(0);

  return (
    <>
      <header>Header</header>
      <main>
        <C selectedRouteIndex={selectedRouteIndex} />{" "}
      </main>
      <footer>Footer</footer>
    </>
  );
};

const Page = (P) => {
  return Renderer.bind(this, P);
};

export default Page;
